import "./ExpenseItem.css";
import React from "react";

function ExpenseItem(expenses) {
  return (<div>
      {expenses.expense.map((expenseItem) => {
        console.log(expenseItem.title);
        <div><h1>expenseItem.title</h1></div>
      })}
      </div>
  );
}

export default ExpenseItem;
